import Layout from "../../components/templates/layouts";
import { Hero } from '../../components/organisms'
import ImageHero from '../../assets/illustrations/daily-stories.svg'
import {SliderHero} from '../../components/organisms'
import {Container, View, Text } from '../../atoms'
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

const Stories = () => {

    return (
        <>
            <Layout title="Stories">
                <Hero 
                    title="Stories Resources" 
                    subtitle="The more that you read the more things you will know." 
                    img={ImageHero}/> 
                <Container padding="100px 0 0 100px" isEqualHeight="80vh">
                    <View width="25%" direction="column">
                        <Text family="daily" size="32" width="50px">Most Popular</Text>
                        <Text margin="30px 30px 0  0">
                            We write various stories here for the present and the future. You can find various stories about us sharing knowledge, adventure and whatever it is here.
                        </Text>
                    </View>
                    <View flexValue="1" >
                        <Carousel responsive={responsive} ssr>
                        <CardStories/>
                        </Carousel>
                    </View>
                </Container> 

            </Layout>
        </>
    )
}

export default Stories;
